import React from 'react';
import './Impressum.css';

function impressum() {
  return (
    <div className='impressum'>
      <h1>Impressum</h1>
      <div className='impressum-content'>
      <p>Angaben gemäß § 5 TMG</p><br></br>
      <p>Pauline Margossian</p><br></br>
      <p>Berlin, Deutschland</p><br></br>
      </div>

    </div>
  );
}

export default impressum;
